import styled from "styled-components";
import { Link } from "react-router-dom";

export const StyledButton = styled(Link)`
  padding: 10px 25px;
  border-radius: 25px;
  font-size: 1 rem;
  text-decoration: none;
  font-weight: 500;
  width: 150px;
  color: #fff;
  cursor: pointer;
  background: #4d4dff;
  margin-top: 15px;
  text-align: center;

  &:hover {
    background: #fff;
    color: #00008b;
    transition: all 0.2s ease-in;
    text-decoration: none;
  }
`;
